import{_ as e,c as n,o as i,ap as r}from"./chunks/framework.BIf3juHF.js";const p=JSON.parse('{"title":"链上赚币","description":"","frontmatter":{"head":[["link",{"rel":"canonical","href":"https://v2vv.com/changes/per-environment-apis"}],["meta",{"property":"og:title","content":"链上赚币"}]]},"headers":[],"relativePath":"changes/per-environment-apis.md","filePath":"changes/per-environment-apis.md"}'),t={name:"changes/per-environment-apis.md"};function h(o,a,c,l,d,s){return i(),n("div",null,a[0]||(a[0]=[r('<h1 id="链上赚币" tabindex="-1">链上赚币 <a class="header-anchor" href="#链上赚币" aria-label="Permalink to &quot;链上赚币&quot;">​</a></h1><p>释放链上奖励潜力，抢先抓住盈利机会。</p><h2 id="_1" tabindex="-1">1 <a class="header-anchor" href="#_1" aria-label="Permalink to &quot;1&quot;">​</a></h2><h2 id="什么是binance链上赚币" tabindex="-1">什么是Binance链上赚币？ <a class="header-anchor" href="#什么是binance链上赚币" aria-label="Permalink to &quot;什么是Binance链上赚币？&quot;">​</a></h2><p>Binance链上赚币可供您利用个人Binance账户轻松参与各种链上协议。您无需执行任何复杂任务或设置，即可以代币形式获得奖励或积分。Binance链上赚币产品对用户的链上质押流程进行了简化，该流程一般更复杂且存在风险。</p><h2 id="_2" tabindex="-1">2 <a class="header-anchor" href="#_2" aria-label="Permalink to &quot;2&quot;">​</a></h2><h2 id="binance链上赚币可提供哪些类型的奖励" tabindex="-1">Binance链上赚币可提供哪些类型的奖励？ <a class="header-anchor" href="#binance链上赚币可提供哪些类型的奖励" aria-label="Permalink to &quot;Binance链上赚币可提供哪些类型的奖励？&quot;">​</a></h2><p>Binance链上赚币根据链上协议提供各种类型的奖励，包括代币和积分。</p><p>对于Binance已经支持的代币，奖励将直接发放到用户的Binance现货账户，用户可以在账户中查看和管理自己的收益。</p><p>对于Binance不支持的代币或积分奖励，用户需要提供其链上钱包地址，Binance将把奖励分发到用户指定的链上地址。</p><h2 id="_3" tabindex="-1">3 <a class="header-anchor" href="#_3" aria-label="Permalink to &quot;3&quot;">​</a></h2><h2 id="binance链上赚币是否保证收益" tabindex="-1">Binance链上赚币是否保证收益？ <a class="header-anchor" href="#binance链上赚币是否保证收益" aria-label="Permalink to &quot;Binance链上赚币是否保证收益？&quot;">​</a></h2><p>链上赚币风险较高，其收益取决于具体的协议，无固定利率，也不保证收益。用户自行承担与各协议相关的风险，建议用户在参与之前做好充分调研。欲了解详情，请参阅我们的链上赚币条款、使用条款和风险提示。</p><h2 id="_4" tabindex="-1">4 <a class="header-anchor" href="#_4" aria-label="Permalink to &quot;4&quot;">​</a></h2><h2 id="binance链上赚币存在哪些风险" tabindex="-1">Binance链上赚币存在哪些风险？ <a class="header-anchor" href="#binance链上赚币存在哪些风险" aria-label="Permalink to &quot;Binance链上赚币存在哪些风险？&quot;">​</a></h2><p>Binance链上赚币是一种高风险产品，其收益取决于具体的协议，无法保证。各协议存在的风险可能不尽相同，包括但不限于： 智能合约漏洞：链上协议可能存在技术漏洞，与智能合约功能相关的风险由用户自行承担。 市场波动：链上协议的收益可能会随市场行情发生波动，从而可能会导致资产贬值。 协议故障：链上协议可能会存在操作或技术问题，从而可能会导致资产损失。 我们建议用户在参与Binance链上赚币之前进行彻底的研究，以了解与其选择的协议相关的潜在风险。Binance对因链上协议问题造成的任何资产损失概不负责。欲了解详情，包括您可能遇到的风险，请参阅我们的链上赚币条款、使用条款和风险提示。</p><h2 id="_5" tabindex="-1">5 <a class="header-anchor" href="#_5" aria-label="Permalink to &quot;5&quot;">​</a></h2><h2 id="如何参与binance链上赚币" tabindex="-1">如何参与Binance链上赚币？ <a class="header-anchor" href="#如何参与binance链上赚币" aria-label="Permalink to &quot;如何参与Binance链上赚币？&quot;">​</a></h2><p>您可以前往链上赚币页面，选择想要加入的协议。Binance将负责集成链上协议，并代表您管理链上操作。Binance将负责集成链上协议，并代表您管理链上操作。 第1步：在Binance首页顶部导航菜单选择【理财】。 第 2 步：前往【进阶赚币】&gt;【链上赚币】。 第3步：点击【申购】，确认您的申购金额及预估奖励。</p><h2 id="_6" tabindex="-1">6 <a class="header-anchor" href="#_6" aria-label="Permalink to &quot;6&quot;">​</a></h2><h2 id="binance链上赚币收益如何计算" tabindex="-1">Binance链上赚币收益如何计算？ <a class="header-anchor" href="#binance链上赚币收益如何计算" aria-label="Permalink to &quot;Binance链上赚币收益如何计算？&quot;">​</a></h2><p>奖励根据用户选择和参与的具体协议进行计算。Binance会将扣除手续费后的收益总额发放给用户，可能与链上收益发放方式有所不同。Binance将根据协议确定最终分配的奖励金额。欲了解详情，请参阅我们的链上赚币条款。</p><h2 id="_7" tabindex="-1">7 <a class="header-anchor" href="#_7" aria-label="Permalink to &quot;7&quot;">​</a></h2><h2 id="奖励何时开始累积" tabindex="-1">奖励何时开始累积？ <a class="header-anchor" href="#奖励何时开始累积" aria-label="Permalink to &quot;奖励何时开始累积？&quot;">​</a></h2><p>奖励将于申购次日 00:00 (UTC) 开始计算。您可在奖励开始累积后的第二天（T+2）前往链上赚币页面查看分配情况。请注意，由于数据的复杂性，可能会有最长 8 小时的延迟。 例如，如果您选择在今天（T 天）质押 BTC，则奖励将在质押第二天（T+1天）开始累积，T 天的奖励金额将在奖励开始累积后的次日（T+2天）发放。</p><h2 id="_8" tabindex="-1">8 <a class="header-anchor" href="#_8" aria-label="Permalink to &quot;8&quot;">​</a></h2><h2 id="申购链上赚币产品后是否可以赎回资产" tabindex="-1">申购链上赚币产品后是否可以赎回资产？ <a class="header-anchor" href="#申购链上赚币产品后是否可以赎回资产" aria-label="Permalink to &quot;申购链上赚币产品后是否可以赎回资产？&quot;">​</a></h2><p>可以，您可以提交赎回申请。在收到资产之前最多需要等待 72 小时，在此期间您可以在理财账户中查看赎回状态。 此外，请注意，如遇网络故障或拥堵，可能会出现潜在处理限制，在此种情况下，赎回可能须遵循Binance设置的限制。</p><h2 id="_9" tabindex="-1">9 <a class="header-anchor" href="#_9" aria-label="Permalink to &quot;9&quot;">​</a></h2><h2 id="提交资产赎回申请后-赎回等待期间是否还能收到奖励" tabindex="-1">提交资产赎回申请后，赎回等待期间是否还能收到奖励？ <a class="header-anchor" href="#提交资产赎回申请后-赎回等待期间是否还能收到奖励" aria-label="Permalink to &quot;提交资产赎回申请后，赎回等待期间是否还能收到奖励？&quot;">​</a></h2><p>不能。赎回等待期间，您赎回的资产将不再产生每日收益。</p><h2 id="_10" tabindex="-1">10 <a class="header-anchor" href="#_10" aria-label="Permalink to &quot;10&quot;">​</a></h2><h2 id="赎回流程开始后-是否可以停止赎回" tabindex="-1">赎回流程开始后，是否可以停止赎回？ <a class="header-anchor" href="#赎回流程开始后-是否可以停止赎回" aria-label="Permalink to &quot;赎回流程开始后，是否可以停止赎回？&quot;">​</a></h2><p>不可以，赎回流程一旦开始即不可逆。不过，如果产品仍有配额，您可以重新申购。</p>',34)]))}const u=e(t,[["render",h]]);export{p as __pageData,u as default};
